import React from "react";

function SliderNumberx({
  activeSlide,
  total,
  pey,
  itemCLICKED,
}: any): JSX.Element {
  return (
    <>
      {itemCLICKED[pey] ? (
        <>
          {" "}
          <div
            style={{
              position: "absolute",
              zIndex: 3,
              right: 21,
              top: "3vh",
              fontFamily: "Arial, Helvetica, sans-serif",
              fontWeight: "bolder",
            }}
          >
            <span
              className="turlight"
              style={{
                height: "200px",
                width: "20px",
                paddingLeft: "5px",
                paddingRight: "5px",
                backgroundColor: "rgba(255,255,255,0.6)",
                padding: "6px",
                borderRadius: "42%",
                fontSize: "0.92vw",
              }}
            >
              {activeSlide + 1}
              <span style={{ fontSize: "1vw" }}>/</span>
              {total}
            </span>
          </div>{" "}
        </>
      ) : null}
    </>
  );
}

export const SliderNumber = React.memo(SliderNumberx);
